select * from temp.sec_master;

CREATE TABLE `temp`.`sec_master` (
  `instrumentid` bigint(20) NOT NULL AUTO_INCREMENT,
  `status` varchar(1) DEFAULT 'A' COMMENT 'A - Active,M - Matured,I - Inactive,D - Defaulted,S - Split,R - Reverse Split',
  `ticker` varchar(20) NOT NULL,
  `cusip` varchar(12) DEFAULT NULL,
  `isin` varchar(15) DEFAULT NULL,
  `name` varchar(60) DEFAULT NULL,
  `assetclass` varchar(40) DEFAULT NULL COMMENT 'Equities, Bonds, Commodities, etc.',
  `subclass` varchar(40) DEFAULT NULL COMMENT 'LargeCap, SmallCap, etc.',
  `type` varchar(30) DEFAULT NULL COMMENT 'Equity,Bond,Cash',
  `style` varchar(30) DEFAULT NULL COMMENT 'Value,Growth,Divident',
  `expenseRatio` double DEFAULT NULL,
  `lowerBoundReturn` double DEFAULT NULL,
  `upperBoundReturn` double DEFAULT NULL,
  `taxableReturn` double DEFAULT NULL,
  `nontaxableReturn` double DEFAULT NULL,
  `inception` date DEFAULT NULL,
  `issuer` varchar(20) DEFAULT NULL,
  `adv3months` double DEFAULT NULL,
  `aum` double DEFAULT NULL,
  `beta` double DEFAULT NULL,
  `securityRiskSTD` double DEFAULT NULL,
  `lowerbound` double DEFAULT '0',
  `upperbound` double DEFAULT '0',
  `yield` double DEFAULT NULL,
  `rbsaFlag` varchar(1) DEFAULT 'N',
  PRIMARY KEY (`instrumentid`)
) ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8;

DELETE FROM `temp`.`sec_master`;


DELETE FROM `invdb`.`sec_master` 
where `sec_master`.`ticker` in (select `ticker` from `temp`.`sec_master`)
or `sec_master`.`ticker` = '';

update `invdb`.`sec_master`
set instrumentid = 0, ticker = 'CASH'
where lower(ticker) = 'cash';

select * from `temp`.`sec_master`;

update `invdb`.`sec_daily_info`, `invdb`.`sec_master`
set `sec_daily_info`.`instrumentid` = `sec_master`.`instrumentid`
where `sec_daily_info`.`ticker` = `sec_master`.`ticker`;

